		case 0x5209: i = 36;*callbacks = RIGHT_MAIN_ENGINE_STARTSTOP_callbacks; break;
		case 0x520A: i = 37;*callbacks = LEFT_MAIN_ENGINE_ROTATE_callbacks; break;
		case 0x520B: i = 38;*callbacks = RIGHT_MAIN_ENGINE_ROTATE_callbacks; break;
		case 0x520C: i = 39;*callbacks = LEFT_BALLONET_OUTTAKE_callbacks; break;
		case 0x520D: i = 40;*callbacks = RIGHT_BALLONET_OUTTAKE_callbacks; break;
		case 0x5302: i = 41;*callbacks = EMER_BEACON_callbacks; break;
		case 0x5307: i = 42;*callbacks = TAIL_MOTOR_SPEED_callbacks; break;
		case 0x5308: i = 43;*callbacks = LEFT_MAIN_ENGINE_THROTTLE_callbacks; break;
		case 0x5309: i = 44;*callbacks = RIGHT_MAIN_ENGINE_THROTTLE_callbacks; break;
		case 0x530C: i = 45;*callbacks = LEFT_BALLONET_INTAKE_callbacks; break;
		case 0x530D: i = 46;*callbacks = RIGHT_BALLONET_INTAKE_callbacks; break;
		case 0x5407: i = 47;*callbacks = TAIL_MOTOR_ROTATE_callbacks; break;
		case 0x540C: i = 48;*callbacks = LEFT_BALLONET_VALVE_callbacks; break;
		case 0x540D: i = 49;*callbacks = RIGHT_BALLONET_VALVE_callbacks; break;
